    0: Wake
    1: N1
    2: N2
    3: N3
    4: REM
  norm_length: epoch
  norm_type: defossez
  pretraining:
    train_dataloader:
      _target_: torch.utils.data.DataLoader
      batch_size: 64
      shuffle: true
      num_workers: 4
      multiprocessing_context: fork
      dataset:
        _target_: base.data.freq_data_loader.DatasetForRandomFrequencies
        n_samples: 100000
        n_freq: ${data.pretraining.n_freqs}
        freq_min: ${data.pretraining.freq_min}
        freq_max: ${data.pretraining.freq_max}
        do_phase_shifts: ${data.pretraining.do_phase_shifts}
        normalize: true
        seed: 0
    valid_dataloader:
      _target_: torch.utils.data.DataLoader
      batch_size: 512
      num_workers: 4
      multiprocessing_context: fork
      dataset:
        _target_: base.data.freq_data_loader.DatasetForRandomFrequencies
        n_samples: 1000
        n_freq: ${data.pretraining.n_freqs}
        freq_min: ${data.pretraining.freq_min}
        freq_max: ${data.pretraining.freq_max}
        do_phase_shifts: ${data.pretraining.do_phase_shifts}
        normalize: true
        seed: 1
    test_dataloader:
      _target_: torch.utils.data.DataLoader
      batch_size: 512
      num_workers: 4
      multiprocessing_context: fork
      dataset:
        _target_: base.data.freq_data_loader.DatasetForRandomFrequencies
